export default function EmpAction() 
{
    return({
        
        type:'EmpAction',
        
        payload:[ 
     {        id:1,
              name:'kumar',
              email:'kumar@gmail.com'
     },
     {        id:2,
              name:'vijay',
              email:'vijay@gmail.com'
     },
     {        id:3,
              name:'satheesh',
              email:'satheesh@gmail.com'
     }
     
     ]
    })
}
